function LineTitle(props) {
    let addClass = "";
    let element = null;
    if (props.OnlyLine === true) {
        if(props.Light === true){
            addClass = "LightLine";
        }
        element = <div className={addClass+" LineTextLine"} style={{marginBottom:"3%"}}></div>;
    }else{
        if(props.Light === true){
            addClass = "LightGreenFontShade LightLine";
        }
        element = <h2 className={addClass+" LineTextLine CursiveFont MdFont"}>{props.Title}</h2>;
    }

    return(
        <div>
       {element}
       </div>
    );
}

export default LineTitle;
